import React from "react";

const styles = {
  left: {
    display: "flex",
    backgroundColor: "blue",
    height: "100vh",
    width: "50%",
  },
  para: {
    marginLeft: "30px",
    fontWeight: "bold",
  },
};

function Header() {
  return (
    <div style={styles.left}>
      <div style={styles.para}>
        <p>LEFT</p>
        <p>LEFT</p>
        <p>LEFT</p>
        <p>LEFT</p>
      </div>
    </div>
  );
}

export default Header;
